require("./nav.css");


export default function Nav(){
var [input,setInput]=useState("")




 function validate(value){
    if(!parseInt(value)){
           alert("no text")
    }
    setInput(value.toLowerCase())
 }

    return (<header>
           <div >
               <form onSubmit={()=>{}}>
                   <input value={input} onInput={(e)=>validate(e.target.value)}></input>
                   <button type="submit">BUSCAR</button>
               </form>

           </div>
    </header>
    )
}
